import React, { useState } from 'react';
import FoodList from './FoodList';
import PickUpRequestForm from './PickUpRequestsForm';
import styles from './FoodDonationApp.module.css';

export default function FoodDonationApp() {
    const [selectedFoodId, setSelectedFoodId] = useState(null);

    return (
        <div className={styles.container}>
            <h1>Food Donation Management</h1>
            <FoodList setSelectedFoodId={setSelectedFoodId} />
            {selectedFoodId && (
                <PickUpRequestForm selectedFoodId={selectedFoodId} setSelectedFoodId={setSelectedFoodId} />
            )}
        </div>
    );
}
